#graphql

fragment VaultFields on Vault {
  debtToken
  debtSymbol
  collateralToken
  collateralSymbol
  vaultId
  leverageTier
  totalApeLocked
  totalTeaLocked
  lockedLiquidity
  apeAddress
}

query VaultQuery {
  vaults {
    ...VaultFields
  }
}

